import React, { useState } from 'react'
import './domain.css'
import { useNavigate } from 'react-router-dom';

const Healthcare = () => {
  const navigate = useNavigate();

  const [answers, setAnswers] = useState({
    qn1: [],
    qn2: [],
    r1: '',
    r2: '',
    r3: '',
    r4: '',
    r5: '',
    r6: '',
    r7: '',
    r8: '',
  });

  const handleInputChange = (event) => {
    const { name, value, type } = event.target;
    if (type === 'checkbox') {
      // Handle checkbox input
      const isChecked = event.target.checked;
      setAnswers((prevAnswers) => ({
        ...prevAnswers,
        [name]: isChecked
          ? [...prevAnswers[name], value]
          : prevAnswers[name].filter((item) => item !== value),
      }));
    } else {
      // Handle other input types
      setAnswers({ ...answers, [name]: value });
    }
  };

  

  const redirectToForm = () => {
    // Save the answers in localStorage
    localStorage.setItem('hcareAnswers', JSON.stringify(answers));
  
    // Redirect to the answers page
    navigate('/answers');
  };
  

  return (
    <div className="fm">
        <form>
          <center><h1 className="title">Healthcare</h1></center>
            <div className="qns">
              <center><h1>Fill the following</h1></center>
                <label><b>1. What tasks or activities do you want to accomplish using cloud services?</b></label><br/>
                <input type="checkbox" name="qn1" value="ehr" onChange={handleInputChange} /> Electronic health record management     <br />
                <input type="checkbox" name="qn1" value="tm" onChange={handleInputChange}/> Telemedicine and video conferencing <br />
                <input type="checkbox" name="qn1" value="dsb" onChange={handleInputChange}/> Data storage and backup <br />
                <input type="checkbox" name="qn1" value="hma" onChange={handleInputChange}/> Healthcare mobile apps <br />
                <input type="checkbox" name="qn1" value="mi" onChange={handleInputChange}/> Medical Imaging <br />
                <input type="checkbox" name="qn1" value="hw" onChange={handleInputChange}/> Hosting Website <br />
                <label><b>2. Are you looking to enhance the efficiency of appointment scheduling and management?</b></label><br/>
                <input type="radio" name="r1" value="r1" onChange={handleInputChange} />Yes  <input type="radio" name="r1" value="r1" onChange={handleInputChange} />No <br />
                <label><b>3. Would you like to improve patient engagement and communication?</b></label><br/>
                <input type="radio" name="r2" value="r2" onChange={handleInputChange} />Yes  <input type="radio" name="r2" value="r2" onChange={handleInputChange} />No <br />
                <label><b>4. Are you interested in enhancing healthcare inventory and supply chain management?</b></label><br/>
                <input type="radio" name="r3" value="r3" onChange={handleInputChange} />Yes  <input type="radio" name="r3" value="r3" onChange={handleInputChange} />No <br />
                <label><b>5. Are you interested in improving healthcare analytics and reporting?  </b></label><br/>
                <input type="radio" name="r4" value="r4" onChange={handleInputChange} />Yes  <input type="radio" name="r4" value="r4" onChange={handleInputChange} />No <br />
                <label><b>6. Would you like to implement a healthcare chatbot for patient inquiries and support?</b></label><br/>
                <input type="radio" name="r5" value="r5" onChange={handleInputChange} />Yes  <input type="radio" name="r5" value="r5" onChange={handleInputChange} />No <br />
                <label><b>7. What is the expected geographical distribution of your users?</b></label><br/>
                <input type="checkbox" name="qn2" value="qn2" onChange={handleInputChange} /> Local / Regional <br />
                <input type="checkbox" name="qn2" value="qn2" onChange={handleInputChange} /> National <br />
                <input type="checkbox" name="qn2" value="qn2" onChange={handleInputChange} /> Global <br />
                <label><b>8. Do you have any existing software?</b></label><br/>
                <input type="radio" name="r6" value="r6" onChange={handleInputChange} />Yes  <input type="radio" name="r6" value="r6" onChange={handleInputChange} />No <br />
                <label><b>9. Would you like to implement patient engagement portals for feedback, reviews, and interaction?  </b></label><br/>
                <input type="radio" name="r7" value="r7" onChange={handleInputChange} />Yes  <input type="radio" name="r7" value="r7" onChange={handleInputChange} />No <br />
                <label><b>10. Do you need a cloud service for remote patient monitoring, early warning systems, and alerts?   </b></label><br/>
                <input type="radio" name="r8" value="r8" onChange={handleInputChange} />Yes  <input type="radio" name="r8" value="r8" onChange={handleInputChange} />No <br />
                <center><button onClick={submitForm} className="btn1">Submit</button></center>
            </div>
        </form>
    </div>
  )
}

export default Healthcare;
